static int64_t pop (void) {
    if (sc < STACK_SIZE) {
        return stack[sc++];
    } else {
        fprintf(stderr, "STACK UNDERFLOW");
        fputc(10, stderr);
        exit(1);
    }
}

static void* pop_ptr (void) {
    int64_t x = pop();
    return (void*)x;
}

static uint8_t pop_u8 (void) {
    int64_t x = pop();
    return (uint8_t)x;
}

static void push (int64_t x) {
    if (sc > 0) {
        stack[--sc] = x;
    } else {
        fprintf(stderr, "STACK OVERFLOW");
        fputc(10, stderr);
        exit(1);
    }
}

